import React from 'react';

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li><a href="/All books">All Books</a></li>
        <li><a href="/genres">Genres</a></li>
        <li><a href="/bestsellers">Best Sellers</a></li>
      </ul>
    </nav>
  );
};

export default Navigation;
